import React from 'react';
import { useSpring, animated } from 'react-spring';

const App = () => {
  const props = useSpring({ opacity: 1, from: { opacity: 0 } });

  return (
    <animated.div style={props}>
      <h1>React Spring Animation</h1>
    </animated.div>
  );
};

export default Home;
